import React, { useState } from 'react';

function ContactForm({ closeForm }) {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: ''
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // You can later replace this alert with real API submission
    alert(`Thank you, ${formData.name}! Your message has been received.`);
    closeForm(); // Close the popup after submission
  };

  return (
    <div className="contact-popup">
      <form onSubmit={handleSubmit}>
        <h2>Contact Us</h2>
        <input
          type="text"
          name="name"
          placeholder="Your Name"
          value={formData.name}
          onChange={handleChange}
          required
        />
        <input
          type="email"
          name="email"
          placeholder="Your Email"
          value={formData.email}
          onChange={handleChange}
          required
        />
        <textarea
          name="message"
          placeholder="Your Message"
          value={formData.message}
          onChange={handleChange}
          required
        />
        <div style={{ display: 'flex', gap: '10px', marginTop: '10px' }}>
          <button type="submit" style={{ background: '#007bff', color: '#fff', padding: '8px', border: 'none', borderRadius: '5px', cursor: 'pointer' }}>
            Send
          </button>
          <button
            type="button"
            onClick={closeForm}
            style={{ background: '#6c757d', color: '#fff', padding: '8px', border: 'none', borderRadius: '5px', cursor: 'pointer' }}
          >
            Cancel
          </button>
        </div>
      </form>
    </div>
  );
}

export default ContactForm;
